import React from 'react';
import { BrowserRouter, Switch, Route } from 'react-router-dom';

import Layout from './Layout';
import Landing from '../pages/Landing';
import Solicitud from '../pages/Solicitud';
import Explicación_Domiciliario from '../pages/Explicación-Domiciliario'
import Explicación_Inversor from '../pages/Explicación-Inversor'
import Registro_Domiciliario from '../pages/Registro-Domiciliario'
import Registro_Inversor from '../pages/Registro-Inversor'
import NotFound from '../pages/NotFound';

function App() {
    return (
        <BrowserRouter>
        <Layout>
            <Switch>
                <Route exact path="/" component={Landing}></Route>
                <Route exact path='/Solicitud' component={Solicitud}></Route>
                <Route exact path='/Como-funciona-domiciliario' component={Explicación_Domiciliario}></Route>
                <Route exact path='/Como-funciona-inversor' component={Explicación_Inversor}></Route>
                <Route exact path='/Registro-usuario' component={Registro_Domiciliario}></Route>
                <Route exact path='/Registro-inversor' component={Registro_Inversor}></Route>

                <Route component={NotFound}></Route>
            </Switch>
        </Layout>
        </BrowserRouter>
    );
}

export default App;
